import React, { Component } from "react";
import viewingitem from "./viewingitem";

export default class Viewing extends Component {
  showViewitem = () => {
    let res = [];
    for (let index = 0; index < 6; index++) {
      res.push(<viewingitem />);
    }
    return res;
  };

  render() {
    return (
      <div className="viewing">
        <div className=" container">
          <div className="row">
            <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 px-0">
              <h3 className="title ">Students are viewing</h3>
            </div>
            <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 px-0">
              <div className="product__items">{this.showViewitem()}</div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
